export const styles = theme => ({
    suggestedtemplateicon: {
        border: "1px solid #0076f1",
        padding: 32,
        display: "flex",
        borderRadius:30,
        justifyContent: "center",
        alignItems: "center",
        minHeight: 300,
        "& img": {
            width: "100%",
        },
    },
    suggestedtemplink: {
        textDecoration: "none",
        color: "#707070",
    },
    suggestedtemplatelabel: {
        marginTop: 22,
        display: "block"
    },
    templateboxpadding: {
        padding: 13,
    }
});
